import React from 'react';
import './Brick.css';

class Brick extends React.Component {
    constructor (props) {
        super (props);
        this.state = {
            value: this.props.value
        }
    }
    render() {
        return (
            <div class='Brick'>
                <p>{this.state.value}</p>
            </div>
        );
    }
}

export default Brick;
